import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

const navbarHeight = 40; // Height of the navbar in pixels
const footerHeight = 40; // Height of the footer in pixels
const contentHeight = `calc(100vh - ${navbarHeight + footerHeight}px)`; // Calculate the remaining height for content

const styles = {
  app: {
    textAlign: 'center',
    backgroundColor: '#f4f4f4',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
  },
  header: {
    backgroundColor: '#333',
    color: 'white',
    padding: '0', // Remove padding
  },
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: `${navbarHeight}px`, // Set height of the navbar
  },
  logo: {
    marginLeft: '20px',
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navUl: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  navLi: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  loginButton: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '20px',
  },
  slider: {
    maxWidth: '800px',
    margin: 'auto', // Center the slider horizontally
    flex: 1, // Take remaining vertical space
    height: contentHeight, // Set height of the content area
  },
  footer: {
    backgroundColor: '#333',
    color: 'white',
    padding: '20px',
    height: `${footerHeight}px`, // Set height of the footer
  },
};

const Header = () => {
  return (
    <header style={styles.header}>
      {/* Removed website name */}
    </header>
  );
};

const NavBar = () => {
  return (
    <nav style={styles.nav}>
      <div style={styles.logo}>Logo</div>
      <ul style={styles.navUl}>
        <li style={styles.navLi}>Home</li>
        <li style={styles.navLi}>Our Missions</li>
        <li style={styles.navLi}>About Us</li>
        <li style={styles.navLi}>Clubs</li>
        <li style={styles.navLi}>Contact Us</li>
      </ul>
      <div style={styles.loginButton}>Login</div>
    </nav>
  );
};

const ImageSlider = () => {
  return (
    <div style={styles.slider}>
      <Carousel showThumbs={false}>
        <div style={{ width: '100%', height: '100%' }}>
          <img alt="Slide 1" src="https://via.placeholder.com/800x300" style={{ width: '100%', height: '100%' }} />
        </div>
        <div style={{ width: '100%', height: '100%' }}>
          <img alt="Slide 2" src="https://via.placeholder.com/800x300" style={{ width: '100%', height: '100%' }} />
        </div>
        <div style={{ width: '100%', height: '100%' }}>
          <img alt="Slide 3" src="https://via.placeholder.com/800x300" style={{ width: '100%', height: '100%' }} />
        </div>
      </Carousel>
    </div>
  );
};

const Footer = () => {
  return (
    <footer style={styles.footer}>
      <p>&copy; 2024 My Website. All rights reserved.</p>
    </footer>
  );
};

function App() {
  return (
    <div style={styles.app}>
      <Header />
      <NavBar />
      <ImageSlider />
      <Footer />
    </div>
  );
}

export default App;
